import React from "react";
import { Route, Switch } from "react-router";
import { LandingPage } from "./pages/Landing/LandingPage";
import { LandingPage as SwapLp } from "./pages/Landing/SwapLandingPage";
import AdminDashboard from "./pages/Admin/admin";
import { FLayout, FMain, FLoader, FContainer } from "ferrum-design-system";
import Header from "./header/header";

const Wrapper = () => {
  return (
    <>
      <Header />
      <FMain>
        <FMain>
          <FGrid spacing={13}>
            <CasperSwap />
            <Withdrawals /> 
          </FGrid>
        </FMain>
      </FMain>
    </>
  )
}


const SwapWrapper = () => {
  return (
    <>
      <Header />
      <FMain>
        <FGrid spacing={13}>
          <CasperSwap />
          <Withdrawals /> 
        </FGrid>
      </FMain>
    </>
  )
}

const BaseRoutes = () => {
  return (
    <>
      <Header />
      <FMain>
        <Switch>
          <Route path="/swap/:bridgePoolAddress" component={
            SwapWrapper
          }></Route>
          <Route path="/withdraw/:bridgePoolAddress" component={
            <FGrid spacing={13}>
              <Withdrawals /> 
            </FGrid>
          }></Route>
        </Switch>
      </FMain>
    </>
  );
};
export default BaseRoutes;
